    <div class="container d-flex flex-column pt-4">
        <div class="row">
            <select id="current-graph" class="form-control">
                <option>Please select the graph to display...</option>
            </select>
        </div>
		<div class="row d-flex flex-fill">
			<div class="col p-1 pt-4 graphbox">

    <script type="text/javascript">
    try {
        const vscode = acquireVsCodeApi();
        function vsCodeGotoLine(file, lineno) {
            if (lineno === -1) {
                return;
            }
            vscode.postMessage({
                command: 'goto_line',
                text: lineno + '|' + file
            });
        }
    } catch (e) {
        console.log("ERROR: FALLBACK TO NO-NAVIGATION MODE");
        function vsCodeGotoLine(file, lineno) {
            console.log(file, lineno);
        }
    }
    function updateSelect(graphs) {
        let select = document.querySelector('select#current-graph');
        select.innerHTML = '';
        graphs.forEach(e => {
            let graph_name = e.name;
            let graph_data = JSON.stringify(e.data);
            let opt = document.createElement('option');
            opt.setAttribute('data-name', graph_name);
            opt.setAttribute('data-graph', graph_data);
            opt.innerText = graph_name;
            select.appendChild(opt);
        })
    }
    document.querySelector('select#current-graph').addEventListener('change', event => {
        let value = event.target.value;
        let opt = Array.from(document.querySelectorAll('option')).find(el => el.textContent === value);
        if (typeof opt !== "undefined") {
            let graph_text = opt.getAttribute("data-graph");
            if (graph_text !== "null") {
                window.GraphModel.update(graph_text);
            }
        }
    });
    window.addEventListener('message', event => {
        const message = event.data;
        switch (message.command) {
            case 'update_model':
                let graphs = message.model;
                updateSelect(graphs);
                break;
        }
    });
    </script>
